export const ADMIN_TAB = 'adminTab';
export const ENODE_TAB = 'enodeTab';
export const ACCOUNT_TAB = 'accountTab';
export default [
  { id: ACCOUNT_TAB, text: 'Accounts' },
  { id: ENODE_TAB, text: 'Nodes' },
  { id: ADMIN_TAB, text: 'Admins' }
];
